import React, {useContext} from 'react';
import ProductImage from './components/productImage';
import Header from './components/header';
import ProductTitle from './components/productTitle';
import ProductDesc from './components/productDescription';
import ProductSpecs from './components/productSpecs';
import QuantityCounter from './components/quantityCounter';

import Footer from './components/footer';

const PageBuilder = (props) =>{
	const {cart} = useContext(QuantityCounter);

	return(
			<div>
	    		<Header cart={cart} />
	    		<div className="container-fluid">
			       <ProductImage imgUrl={props.data.imgUrl} name={props.data.name} />
			       <ProductTitle name={props.data.name} power={props.data.power} quantity={props.data.quantity} />
			       <QuantityCounter product={props.data}/>
			       <ProductDesc description={props.data.description} />
			       <ProductSpecs brand={props.data.brand} weight={props.data.weight} height={props.data.height} length={props.data.length} width={props.data.width} modelCode={props.data.modelCode} colour={props.data.colour} />

			    </div>
			    <Footer />
		    </div>
		)
	}
